import React, { Component } from "react";
import AllergensModal from "../Modal/AllergensModal";
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';

class Card extends React.Component {
	
    constructor(props){
        super(props);
    }
    
    
    state = {

        openAllergenModal: false
  };


  


    handleAllergenModal = () => {
        this.setState({openAllergenModal: true });
        };



	render() {
	

		return (
      
      <React.Fragment>
        <div className="card-style" onClick={handleAllergenModal}>
        <h1>{this.props.dermatologist.EntityDTO.name} {this.props.dermatologist.EntityDTO.surname}</h1>
        <Dialog
        open={this.state.openAllergenModal}
        
        aria-labelledby="alert-dialog-title"
        aria-describedby="alert-dialog-description"
      >
        <DialogTitle id="alert-dialog-title">{"Use Google's location service?"}</DialogTitle>
        <DialogContent>
          <DialogContentText id="alert-dialog-description">
            Let Google help apps determine location. This means sending anonymous location data to
            Google, even when no apps are running.
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button  color="primary">
            Disagree
          </Button>
          <Button  color="primary" autoFocus>
            Agree
          </Button>
        </DialogActions>
      </Dialog>
        </div>
     
	    </React.Fragment>
        

		);
	}
}

export default Card;
